import * as S from '../styles/MainPage.style'

function MainPage() {
  return (
    <S.Container>
      <S.Header>
        <div>로고</div>
        <div>Home</div>
        <div>Routine</div>
        <div>MyPage</div>
      </S.Header>
    </S.Container>
  )
}

export default MainPage;
